import Form from "./Form/Form";
import { Route, Switch, Redirect } from "react-router-dom";

function App() {
  return (
    <div>
      <main>
        <Route path="/" exact>
          <Redirect to="/form" />
        </Route>
        <Route path="/form">
          <Form />
        </Route>
      </main>
    </div>
  );
}

export default App;
